import React, { Component,Fragment } from 'react';


class ShowPlayers extends Component {
  constructor(props){
    super(props)
    this.state = {
      players : props.location.state.playerInGame
    }
  }
  render() {
    let index = 0;
    const {player} = this.state.players;
    return (
      <Fragment>
        <table>
        <th>Player Name</th>
              <th>Last Name</th>
              <th>Total Time</th>
              <th>Distance (km)</th>
              <th>Sprint Distance</th>
              <th> Total Sprints</th>
              <th>Sprints Avg(MP/H).</th>
              <td>
              {player.firstName.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.lastName.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.totalTime.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.distance.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.sprintDistance.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.sprints.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {player.sprintAvgID.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
        </table>
      </Fragment>
    )
  }
}
export default ShowPlayers;
